import React, { useEffect, useState } from "react";

const eachStep = 100 / 17;
const TimerCircleRow = () => {
  const [current, setCurrent] = useState<number>(1);
  const [timerRowCount, setTimerRowCount] = useState();

  useEffect(() => {
    const idTimout = setTimeout(() => {
      setTimerRowCount(eachStep * current);
    }, 17000);
    return () => clearTimeout(idTimout);
  }, []);
  return (
    <circle
      cx="70"
      cy="70"
      r="73"
      strokeDashoffset={445 - (400 * 2) / 100}
    ></circle>
  );
};

export default TimerCircleRow;
